import React from 'react';
import ScrollToBottom from 'react-scroll-to-bottom'

import './Message.css';

const Message = ({messages}) => (
    <ScrollToBottom>
        {messages.map((message, i) => <div key={i}></div>)}

    </ScrollToBottom>
)

export default Message;
